import React from 'react';
import ContactConstants from '../constants/ContactConstants';
import '../../App.css';

export default function Contact() {
  return (
  <div>
    <div className="contactHeading">
      <h1>{ContactConstants.CONTACT_HEADING}</h1>
      <p>{ContactConstants.CONTACT_PARAGRAPH}</p>
    </div>
    <div className='contactPage'>
      <iframe src="https://docs.google.com/forms/d/e/1FAIpQLSeEOvzKrZo3btYwTtoPp4RjL_UHQPmybouGpWYAf_JxDDC8qw/viewform?embedded=true" 
        width="640" 
        height="750" 
        frameborder="0" 
        marginheight="0" 
        marginwidth="0">Loadingâ€¦</iframe>
    </div>
    
    
  </div>
  )
}
